import React from 'react'
import styled from 'styled-components';

const x = 247;

const Container = styled.div`
    background-color: rgba(${x}, ${x}, ${x}, 0.6);
    height: 35%;
    align-items: center;
`;

//props: title paragraph icon
export default function FeatureBox(props) {
    return(
    <Container>
        <div>
            <>{props.icon}</>
            <h3>{props.title}</h3>
            <p>{props.paragraph}</p>
        </div>
    </Container>)

}
